// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

// state variables

contract Lottery {
    address payable[] participant;
    address payable public winner;
    address public lotteryManager;

    uint256 number;

    //modifier

    function participate() public payable {
        require(msg.value == 3 ether);
        participant.push(payable(msg.sender));
        
    }

    function getBalance() public view returns (uint) {
        require(msg.sender == lotteryManager);
        return address(this).balance;
    }

    function getRandomWinner() public payable {
        require(msg.sender == lotteryManager);
        bytes32 rand = blockhash(block.number - 1);
        bytes32 rand2 = blockhash(block.number - 2);
        bytes32 rand3 = blockhash(block.number - 3);

      uint256  randomNumber = uint256(keccak256(abi.encodePacked(rand, rand2, rand3)));
        number = randomNumber % participant.length;
        winner = participant[number];
        winner.transfer(getBalance());
        participant=new address payable[](0);
    }

    function getWinnerBalance() public view returns (uint) {
        require(msg.sender == participant[number]);
        return msg.sender.balance;
    }
}

